                          {'text': u"Gloom rilascia un odore fetido dal pistillo del suo fiore. Quando \xe8 in pericolo, l'olezzo peggiora. Quando invece si sente tranquillo e sicuro, non emana questa sostanza maleodorante.",
                           'version_ids': ['25']},
