                          {'text': u'Its body constantly discharges electricity. Getting close to it will make your hair stand on end.',
                           'version_ids': ['5']},
                          {'text': u'When two ELECTABUZZ touch, they control the electric currents to communicate their feelings.',
                           'version_ids': ['6']},
